import Phaser from "phaser";
import MainScene from './MainScene.js';

import bgI from 'data-url:../img/logo.png';

let loadMain = false;
let audioDecoded = false;
let countTexture = 0;
let countDecoded = 0;

export default class PreloaderScene extends Phaser.Scene {
    constructor () {
        super({ key: 'Preload' })
    }

    preload () {
        console.log('%cSCENE::PreloaderScene', 'color: #fff; background: #f00;')

        this.sound.decodeAudio('music', 'data:audio/mpeg;base64,');

        this.textures.addBase64('bg', bgI)

        this.textures.on('onload', () => countTexture++, this)
        this.sound.on('decoded', this.decodeAudio, this)
    }
    create() {
        loadMain = true
    }
    decodeAudio() {
    	countDecoded++
    	if(countDecoded >= 1) {audioDecoded = true}
    }
    update() {
        if (countTexture >= 1 && loadMain && audioDecoded) {
            console.log('%cSCENE::Loaded', 'color: #000; background: #0f0;')
            this.scene.start("Main")
        }
    }
}


